import React, { Component } from "react";
import "./App.css";
import "./About.css";

class About extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className="About">
        <div className="para">
          <p>
            I <sup>tirza</sup> am a graphic designer with background in
            Interactive Media Arts. I love Photoshop as much as I love my text editors (shout out to Atom and p5 Editor!). {"\n"} I've worked on posters, editorial layout,
            and digital UI designs.{"\n"} I'm always happy to talk about design,
            coffee shops, or the wireless candy dispenser + bookmark project I
            once made in college at <strong> tirza.alberta@nyu.edu</strong>
            <em>or</em> click <strong>say hi</strong>
          </p>
        </div>
      </div>
    );
  }
}

export default About;
